import React, { Component } from "react";
import Searchbox from "./search_box";
//import Navbar from 'navbar-react'
//import { Container} from 'react-containers';
import { Form, FormControl, Container, Button, Navbar, Nav, NavItem, NavDropdown, MenuItem } from 'react-bootstrap';



class Header extends Component {




  render() {

    return (
      <Navbar bg="primary" variant="dark" expand="lg">
        <Container fluid>
          <Navbar.Brand href="#">ArgosDB Datasets</Navbar.Brand>
          <Navbar.Toggle aria-controls="navbarScroll" />
          <Navbar.Collapse id="navbarScroll">
            <Nav className="me-auto my-2 my-lg-0" navbarScroll>
              <Nav.Link href="#action1">Home</Nav.Link>
              <Nav.Link href="#action2">FAQ</Nav.Link>
              <Nav.Link href="#action2">Release History</Nav.Link>
              <NavDropdown title="Link" id="navbarScrollingDropdown"
                style={{display:"none"}}
              >
                <NavDropdown.Item href="#action3">Action</NavDropdown.Item>
                <NavDropdown.Item href="#action4">Another action</NavDropdown.Item>
                <NavDropdown.Divider />
                <NavDropdown.Item href="#action5">
                  Something else here
                </NavDropdown.Item>
              </NavDropdown>
            </Nav>
            <Searchbox onSearch={this.props.onSearch} onKeyPress={this.props.onKeyPress}/>
          </Navbar.Collapse>
        </Container>
      </Navbar>
    );
  }
}

export default Header;
